  namespace: SuperOffice.CRM.Rows
  summary: >-
    Typed facade for an object[] that contains all the fields of the FreeTextWords table, intended for

    use with DatabaseOperations.DatabaseOperations.ImportTable for bulk import of data.
  remarks: >-
    The bulk import system is based on generic row data, represented as an array of object. While this

    fits the bulk import functionality well, it may be convenient to have a typed, named way of accessing

    the elements of such an object. This class has an object[] as its data carrier, together with

    strongly typed access members.

    <p></p>

    On creation, the array is dimensioned and all members initialized with 'blank' values for their

    types (never null). There is an implicit conversion operator to object[], and it is also possible

    to access the array directly.
